<html>
	<head>
		<title>
			Image Map Example
		</title>
	</head>
	<body bgcolor="#000000"><center>
	<img src="youtuberect.jpg" usemap="#getmap" vspace="150">
	<map name="getmap">
		<area shape="rect" coords="30,226,279,478" href="https://instagram.com">
		<area shape="circle" coords="453,159,153" href="https://facebook.com">
		<area shape="rect" coords="511,350,1012,472" href="https://youtube.com">
	</map>
	</center>
	</body>
</html>
